import React from "react";
import containerCard from "../Conteiners/containerCard";

export default function Home(){
    return (
        <div>
            <h3> Este es el Home </h3>

            <div>
                <select>
                    <option>Actividad turistica</option>
                    <option>Continente</option>
                </select>

                <select>
                    <option>Ordenar A-Z</option>
                    <option>Ordenar Z-A</option>
                    <option>Max. poblacion ▼</option>
                    <option>Min. poblacion ▲</option>
                </select>

            <containerCard/>
















            </div>
        </div>
    )
};
